import React from 'react';
import fox from '../images/fox.png';

const fullPost = () => {
  return (
    <div>
        <div>
          <img src={fox} />
          <h1>Nick Wilde</h1>
        </div>
        <div>
          <p></p>
        </div>
    </div>
  )
}

export default fullPost
